			int g = 0;
			int b = 0;
			int hi = 0;
			int lo = 0;
			int val = 0;
			double sat = 0;
			double hue = 0;
			int dir = 0;
			int mid = 0;
			if ( !Lang13.Bool( rgb ) ) {
				return "#0000000";
			}
			RGB = GlobalFuncs.ReadRGB( rgb );
			if ( !( RGB != null ) ) {
				return "#0000000";
			}
			r = Lang13.Int( RGB[1] );
			g = Lang13.Int( RGB[2] );
			b = Lang13.Int( RGB[3] );
			hi = Num13.maxInt( r, g, b );
			lo = Num13.minInt( r, g, b );
			val = hi;
			sat = ( hi != 0 ? Num13.round( ( hi - lo ) * 255 / hi, 1 ) : 0 );
			hue = 0;
			if ( sat != 0 ) {
				if ( hi == r ) {
					if ( lo == b ) {
						hue = 0;
						dir = 1;
						mid = g;
					} else {
						hue = 1535;
						dir = -1;
						mid = b;
					}
				} else if ( hi == g ) {
					if ( lo == r ) {
						hue = 512;
						dir = 1;
						mid = b;
					} else {
						hue = 511;
						dir = -1;
						mid = r;
					}
				} else if ( hi == b ) {
					if ( lo == g ) {
						hue = 1024;
						dir = 1;
						mid = r;
					} else {
						hue = 1023;
						dir = -1;
						mid = g;
					}
				}
				hue += dir * Num13.round( ( mid - lo ) * 255 / ( hi - lo ), 1 );
			}
			return GlobalFuncs.hsv( hue, sat, val, Lang13.IntNullable( ( RGB.len > 3 ? RGB[4] : null ) ) );
